import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Property.css';

const Property = ({ property, variant }) => {
  const {
    id,
    image,
    title,
    price,
    beds,
    baths,
    sqft,
    status,
    address,
    location,
    daysOnMarket,
    propertyType,
    yearBuilt
  } = property;

  const statusClass = status ? status.toLowerCase().replace(/\s+/g, '-') : '';

  return (
    <div className={`property-card ${variant || ''}`}>
      <div className="property-image">
        <img src={image} alt={title || "Swiss Chalet"} />
        {status && (
          <div className={`status-badge ${statusClass}`}>
            {status}
          </div>
        )}
      </div>
      <div className="property-details">
        {title && <h3 className="property-title">{title}</h3>}
        <div className="property-price">{price}</div>
        <div className="property-specs">
          <div>{beds} beds</div>
          <div>{baths} baths</div>
          <div>{new Intl.NumberFormat().format(sqft)} sqft</div>
        </div>
        {propertyType && (
          <div className="property-type">{propertyType}</div>
        )}
        {yearBuilt && (
          <div className="property-year">Built in {yearBuilt}</div>
        )}
        <div className="property-address">{address}</div>
        {location && (
          <div className="property-location">{location}</div>
        )}
        <div className="property-days">
          {daysOnMarket} days on market
        </div>
        <Link to={`/property/${id}`} className="view-details-btn">
          View Details
        </Link>
      </div>
    </div>
  );
};

export default Property;
